import React from 'react';
import DragAndDropBox from './DragAndDropBox';
import Navbar from './Navbar';


function App() {
  return (

    <div className="App">
      <header className="App-header">
      <Navbar/>
      <DragAndDropBox />
      </header>
    </div>
  );
}

export default App;
